import React, { Component } from 'react'
import WrapComponent from '@/components/wrapper'
import { Tab } from 'semantic-ui-react'
import TableExamplePagination from './campaignList'
import { campaignListData } from './dummyData'
import Select from 'react-select'
import './index.scss'
import { SmallHeading } from '@/components/headings/index'

export const NotificationSoundOPtions = [{ value: 'Default', label: 'Default' }]
const panes = [
    { menuItem: 'Tab 1', render: () => <Tab.Pane attached={false}>Tab 1 Content</Tab.Pane> },
    { menuItem: 'Tab 2', render: () => <Tab.Pane attached={false}>Tab 2 Content</Tab.Pane> },
    { menuItem: 'Tab 3', render: () => <Tab.Pane attached={false}>Tab 3 Content</Tab.Pane> },
]

const headers = [
    { key: 'name', value: 'Campaign Name' },
    { key: 'campaignType', value: 'Type' },
    { key: 'channel', value: 'Channel' },
    { key: '', value: 'Actions' },
    { key: 'scheduledTime', value: 'Schedule Time' },
]

class CampaignManage extends Component {
    render() {
        return (
            <WrapComponent>
                <div className="section">
                    {/* table section */}
                    <div className="flex-space-bt">
                        <div>
                            <SmallHeading>Create date</SmallHeading>
                            <Select
                                closeMenuOnSelect={false}
                                isMulti={false}
                                options={NotificationSoundOPtions}
                                theme={theme => ({
                                    ...theme,
                                    borderRadius: 0,
                                    colors: {
                                        ...theme.colors,
                                        text: '#f1f1f1',
                                        primary25: '#74d69e',
                                        primary: '#74d69e',
                                    },
                                })}
                                placeholder="Created Date"
                            />
                        </div>
                        <div>
                            {' '}
                            <SmallHeading>Create date</SmallHeading>
                            <Select
                                closeMenuOnSelect={false}
                                isMulti={false}
                                options={NotificationSoundOPtions}
                                theme={theme => ({
                                    ...theme,
                                    borderRadius: 0,
                                    colors: {
                                        ...theme.colors,
                                        text: '#f1f1f1',
                                        primary25: '#74d69e',
                                        primary: '#74d69e',
                                    },
                                })}
                                placeholder="Created Date"
                            />
                        </div>
                        <div>
                            <SmallHeading>Create date</SmallHeading>
                            <Select
                                closeMenuOnSelect={false}
                                isMulti={false}
                                options={NotificationSoundOPtions}
                                theme={theme => ({
                                    ...theme,
                                    borderRadius: 0,
                                    colors: {
                                        ...theme.colors,
                                        text: '#f1f1f1',
                                        primary25: '#74d69e',
                                        primary: '#74d69e',
                                    },
                                })}
                                placeholder="Created Date"
                            />
                        </div>
                        <div>
                            {' '}
                            <SmallHeading>Create date</SmallHeading>
                            <Select
                                closeMenuOnSelect={false}
                                isMulti={false}
                                options={NotificationSoundOPtions}
                                theme={theme => ({
                                    ...theme,
                                    borderRadius: 0,
                                    colors: {
                                        ...theme.colors,
                                        text: '#f1f1f1',
                                        primary25: '#74d69e',
                                        primary: '#74d69e',
                                    },
                                })}
                                placeholder="Created Date"
                            />
                        </div>
                    </div>
                    <TableExamplePagination
                        loading={false}
                        data={campaignListData.campaigns}
                        headers={headers}
                    />
                </div>
            </WrapComponent>
        )
    }
}

export default CampaignManage
